#!/usr/bin/python3

def pattern_matching(text, pattern):
    k = len(pattern)
    n = len(text) - k + 1
    indecies = []
    for i in range(n):
        if(text[i:i+k] == pattern):
            indecies.append(i)
    return indecies


indecies = (pattern_matching("", "ACGTGTGAC"))

for i in range(len(indecies)):
    print(indecies[i])
